import { Injectable } from '@angular/core';
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import {ScanCategoryType} from "../scan/scan-category.type";
import {scan} from "rxjs";
import {JsonObject} from "@angular/compiler-cli/ngcc/src/packages/entry_point";
pdfMake.vfs = pdfFonts.pdfMake.vfs

@Injectable({
  providedIn: 'root'
})
export class PdfService {

  constructor() { }

  public generatePDF(scanCategories: ScanCategoryType[], name: string, website: string): void {
    let columns: any = [{text: "Naam", italics: true}, {text: "Geslaagd", italics: true}, {text: "Uitleg", italics: true}];
    let docDefinition = {
      info: {
        title: 'Get Big Marketing - Scan Resultaten',
        author: 'Severin, Vincent'
      },
      header: {
        table: {
          widths: ["*"],
          body: [
            [
              {
                stack: [
                  {
                    text: 'Get Big Marketing - Beveiliging Scan Resultaten'
                  }
                ],
                fontSize: 16,
                bold: true,
                margin: [40, 17, 0, 0]
              },
            ]
          ]
        },
        layout: 'noBorders',
      },
      footer: {
        table: {
          widths: ["*"],
          body: [
            [
              {
                stack: [
                  {
                    text: 'Adres: Boerhaavelaan 40, 2713 HX Zoetermeer\n'
                  },
                  {
                    text: 'Website: www.getbigmarketing.nl\n',
                    link: 'www.getbigmarketing.nl'
                  },
                  {
                    text: 'Email: info@getbigmarketing.nl\n',
                    link: 'info@getbigmarketing.nl'
                  },
                  {
                    text: 'Telefoon:+31(0)6 57 83 5752'
                  }
                ],
                fontSize: 7,
                margin: [40, 0, 0, 0]
              },
            ]
          ]
        },
        layout: 'noBorders',
      },
      content: [
        {
          image: 'data:image/png;base64,',
          alignment: 'right',
          width: 50,
          height: 50,
        },
        {
          text: `Geachte ${name},\n\n` +
            `Uw website, ${website}, is succesvol gescand op veiligheid.\n` +
            'In dit document staan de uitgebreide resultaten van deze scan.\n\n' +
            'Met vriendelijke groet,\n\n' +
            'Het GetBigMarketing Team\n\n\n'
        },
        {
          text: `${scanCategories[0].title} (score: ${scanCategories[0].grade})`,
          bold: true,
          margin: [0, 0, 0, 5],
          decoration: 'underline'
        },
        this.createTable(scanCategories[0], columns)
      ]
    };
    // pdfMake.createPdf(docDefinition).download('GetBigMarketing_Scan-Resultaten.pdf');
    pdfMake.createPdf(docDefinition).open();
  }

  private createTable(scanCategory: ScanCategoryType, columns: string[]): any {
    return {
      table: {
        headerRows: 1,
        widths: ['*', '*', '*'],
        body: this.createTableBody(scanCategory, columns),
      }
    };
  }

  private createTableBody(scanCategory: ScanCategoryType, columns: string[]): any {
    let body = [];

    body.push(columns);

    Object.entries(scanCategory.result).forEach(([key, value]: any) => {
      let row = [];
      row.push(value['name']);
      row.push(value['pass'] == true ? "Ja" : "Nee");
      row.push(value['pass'] == false ? value['score_description'] : "n.v.t.");

      body.push(row);
    });

    return body;
  }
}
